import { DataBase } from './DataBase';
import Singleton from '../util/Singleton';
/**
 * 数据管理器
 * 管理所有的数据类对象
 */
export default class DataManager extends Singleton {
    private _map;
    private parseCallback;
    constructor();
    /**
     * 返回指定键对应的数据对象
     * @param responseKey 指定键
     */
    getData(responseKey: string): DataBase;
    /**
     * 在数据管理器中注册对象
     * @param responseKey 指定键
     * @param data 数据对象
     */
    registerData(responseKey: string, data: DataBase): void;
    onParse(callback: Function): void;
    /**
     * 接收到服务器数据进行解析
     * @param data
     */
    parse(data: any): void;
}
